<template>
  <div>
    <Toolbar
      v-bind:show-share="true"
      @showShareCopied="showSnackbar"
    />

    <div class="quiz-container" style="margin: 16px;">
      <div class="quiz-form" v-if="showQuiz">
        <div style="float: left">
          <form>
            <h3 v-html="question['question-text']"></h3>

             <div class="answers">
              <strong>Choices:</strong>
              <ul>
                <li v-for="answer in answers"
                    v-bind:key="answer"
                    v-bind:value="answer"
                    v-on:click="pickAnswer">
                  {{answer}}
                </li>
              </ul>
            </div>
          </form>
        </div>
        <div style="float: left; margin-left: 16px; background-color: red; overflow: auto; padding: 10px">
          <div class="player-heading">Players</div>
          <ul id="players-ul">
            <li v-for="player in players"
                v-bind:key="player.Name"
                v-bind:value="player.Name"
                v-on:click="pickAnswer">
              {{player.Name}} ({{ player.Score }})
            </li>
          </ul>
        </div>
      </div>

      <div class="passed" v-if="showPass">
        <img
          src="data:image/png;base64,"
          width="200"
          height="200"
          alt=""/>
        <div class="failed-text">You got it!</div>
      </div>

      <div class="failed" v-if="showFail">
        <img
          src="data:image/png;base64,"
          width="200"
          height="200"/>
        <!-- <div class="failed-text">The correct answer is: {{ correctAnswerResult }}</div> -->
      </div>
    </div>
    <md-snackbar md-position="center"
                 :md-active.sync="showShareCopied"
                 :md-duration="snackbarDuration">
      Quiz Link copied to clipboard
    </md-snackbar>
  </div>
</template>

<script>

  import { config } from '../constants/config';
  import Toolbar from "./Toolbar";

  export default {
    name: 'HelloWorld',
    components: {Toolbar},
    props: {
      quizId: String,
      name: String,
    },

    mounted() {
      console.log("quiz mounted", this.quizId, this.name, this.$route.query.options);
      this.socket = new WebSocket(`ws://${config.host}:${config.port}/quizzes/${this.quizId}/${this.name}?options=${this.$route.query.options}`);
      this.socket.onmessage = (event) => {
        console.log('GOT MESSAGE', { event }, typeof event.data);

        const obj = JSON.parse(event.data);

        console.log(obj, 'MESSAGE PARSED');

        if (obj.question) {
          this.question = obj.question;
          this.answers = obj.question.choices
        }
        if (obj.totalQuestions) {
          this.totalQuestions = obj.totalQuestions;
        }
        if (obj.players) {
          this.players = obj.players;
        }

        if (obj.type === 'wrong-answer') {
          this.showWrongAnswer();
        }

      };
      this.socket.onopen = (event) => {
        console.log(event, 'CONNECTED WEBSOCKET');
      };
    },
    data() {
      return {
        question: {},
        players: [],
        correctIndex: this.correctIndex,
        correctAnswer: this.correctAnswer,
        answers: this.answers,
        showQuiz: true,
        showFail: false,
        showPass: false,
        totalQuestions: 1,
        correctQuestions: 0,
        wrongQuestions: 0,
        showShareCopied: false,
        snackbarDuration: 4000,
        socket: null,
        debug: '',
      };

    },

    methods: {
      // Let's the user know they messed up
      showWrongAnswer() {
        var self = this;
        this.showQuiz = false;
        this.showPass = false;
        this.showFail = true;

        setTimeout(() => {
          self.showQuiz = true;
          self.showPass = false;
          self.showFail = false;
        }, 1000);
      },

      showRightAnswer() {
        var self = this;
        this.showQuiz = false;
        this.showPass = true;
        this.showFail = false;

        setTimeout(() => {
          self.showQuiz = true;
          self.showPass = false;
          self.showFail = false;
        }, 1000);
      },

      showSnackbar() {
        this.showShareCopied = true;
      },

      goHome() {
        this.$router.push("/");
      },

      // Handles the event of a user picking an user
      pickAnswer(e) {
        this.socket.send(JSON.stringify({
          type: 'answer',
          data: e.target.innerText,
          answer: e.target.innerText
        }));
      }
    }
  };
</script>

